import React, { useState } from 'react';
import { Form, Input, Checkbox, Button } from 'antd';

const signup = () => {
  const [term, setTerm] = useState(false);
  const onSubmit = () => {};

  const onChangeId = () => {};

  const onChangeNickname = () => {};

  const onChangePassword = () => {};

  const onChangePasswordCheck = () => {};

  const onChangeTerm = () => {};

  return (
    <Form onSubmit={onSubmit}>
      <div>
        <label htmlFor="user-id">아이디</label>
        <br />
        <Input name="user-id" required onChange={onChangeId} />
      </div>
      <div>
        <label htmlFor="nickname">닉네임</label>
        <br />
        <Input name="nickname" required onChange={onChangeNickname} />
      </div>
      <div>
        <label htmlFor="user-password">비밀번호</label>
        <br />
        <Input name="user-password" required onChange={onChangePassword} />
      </div>
      <div>
        <label htmlFor="user-passwordCheck">비밀번호체크</label>
        <br />
        <Input
          name="user-passwordCheck"
          require
          onChange={onChangePasswordCheck}
        />
      </div>
      <div>
        <Checkbox name="user-term" value={term} onChange={onChangeTerm}>
          약관동의
        </Checkbox>
      </div>
      <div>
        <Button type="primary" htmlType="submit">
          가입하기
        </Button>
      </div>
    </Form>
  );
};

export default signup;
